Vou te contar uma história.... 

Estava em jejum intermitente! Decidi quebrar o jejum com um chocolate quente cheio de açucar.

Em menos de meia hora bateu uma fome do cão! Aquela vontade monstra de comer doce! 

No dia seguinte ja acordei com fome! O jejum ficou difícil! 

Nesse dia eu quebrei a Rotina Top Player! 

Ao quebrar o jejum com qualquer tipo de carbo que gera um pico de açucar no sangue é um tiro no pé!!! 🔥

Basta um dia chutando o balde! E o cérebro saca o estímulo de recompensa! A dopamina dispara com o açucar e sua mente rebelde deseja repetir a dose! 

Hoje tenho duas opções: Não tomo café da manhã e faço a minha manhã top player em jejum. 
Ou tomo um belo shot matinal / Bebida poderosa! 

O mais interessante é testar e sentir o tamanho do eco que apenas um dia desatento pode ter em nossa mente! Eu sempre testo! 

O cérebro não perdoa! Ele quer mais estímulos! Mais glicose! Não brinque com a sua máquina sem saber lidar com auas consequências! 

Dentro da Comunidade Close Friends eu compartilho Hacks sobre Biohacking e como você pode colocar essa máquina chamada corpo para trabalhar ao seu favor! 👊👊

